import React from 'react';
// import './style.less'
import Drag from '../../components/Drag'

export default function Overview() {
  const moreClick = () => {
    console.log('tell me which num')
  }
  const clickPendingNum = (pendingNum) => {
    console.log('overview 点击待处理数量', pendingNum)
  }
  return (
    <div>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} title='第一个dragDiv'>
        <div style={{height: '100px',width: '100px', backgroundColor:'orange'}}></div>
      </Drag>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} title='第二个dragDiv' clickPendingNum={() => clickPendingNum(2)} moreClick={moreClick}>
        <div style={{height: '100px',width: '100px', backgroundColor:'red'}}></div>
      </Drag>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} title='第三个dragDiv' clickPendingNum={clickPendingNum(3)}>
        <div style={{height: '100px',width: '100px', backgroundColor:'green'}}></div>
      </Drag>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} title='第四个dragDiv' clickPendingNum={clickPendingNum(4)}>
        <div style={{height: '100px',width: '100px', backgroundColor:'blue'}}></div>
      </Drag>
    </div>
  );
}
